INSERT INTO `wp_ak_email_templates` (`id`, `email_template_name`, `email_subject`, `email_message`, `default_message`, `email_template_status`) VALUES
(1, 'Appointment Approved by service provider', 'Appointment Approved by service provider', '', 'Hi {{customer_name}},<br /><br />Your appointment for <br />{{booking_detail}}<br /> has been approved. <br /><br /> Thank You, <br /> {{company_name}}', 'e'),
(2, 'Appointment Rejected by service provider', 'Appointment Rejected by service provider', '', 'Hi {{customer_name}},<br /><br />This is the confirmation that your appointment for <br />{{booking_detail}}<br /> has been rejected. <br /><br /> Rejection reason: <br /> {{appointment_reject_reason}} <br /><br />    Thank You, <br /> {{company_name}}', 'e'),
(3, 'Appointment Cancel by you', 'Appointment Cancelled by you', '', 'Hi {{customer_name}},<br /><br />Your appointment for  <br />{{booking_detail}}<br /> has been cancelled by you. <br /><br />             Cancellation reason: <br /> {{appointment_cancel_reason}} <br /><br />    Thank You, <br /> {{company_name}}', 'e'),
(4, 'Appointment Cancel by Service Provider', 'Appointment Cancelled by Service Provider', '', 'Hi {{customer_name}},<br /><br />Your appointment for  <br />{{booking_detail}}<br /> has been cancelled by service provider. <br /><br />             Cancellation reason: <br /> {{appointment_cancel_reason}} <br /><br />    Thank You, <br /> {{company_name}}', 'e'),
(5, 'Appointment Completed', 'Appointment Completed', '', 'Hi {{customer_name}}, <br /><br /> Your appointment  for<br />{{booking_detail}}<br /> is completed. <br /><br />    Thank You, <br /><br /> {{company_name}}', 'e'),
(6, 'Appointment Request', 'Appointment Request', '', 'Hi {{customer_name}},<br /><br />You have successfully booked an appointment. Your appointment details are noted below:<br/><br/>{{booking_detail}}<br/><br/>Please note that your appointment is tentative and will be confirmed.<br/><br/>Regards,<br/>{{company_name}}', 'e'),
(7, 'Appointment Reminder', 'Appointment Reminder', '', 'Hi {{customer_name}}, <br /><br /> This is reminder notification for your appointment for <br />{{booking_detail}} <br /><br /> Thank You, <br /> {{company_name}}', 'e'),
(8, 'Appointment Marked As No Show', 'Appointment Marked As No Show', '', 'Hi {{customer_name}}, <br /><br /> We are sorry that your appointment for <br />{{booking_detail}}<br /> has been marked as no-show. <br /><br /> Thank You, <br /> {{company_name}}', 'e'),
(9, 'New Appointment Request Requires Approval', 'New Appointment Request Requires Approval', '', 'Hi {{service_provider_name}}, <br /><br /> You have a new appointment request as follows,<br />{{booking_detail}}<br /> Please proceed with confirm or reject action. <br /><br />  Customer details as follows: <br /> {{appoinment_client_detail}} <br /><br /> Thank You, <br /> {{company_name}}', 'e'),
(10, 'Appointment Approved', 'Appointment Approved', '', 'Hi {{service_provider_name}}, <br /><br /> You have successfully confirmed the following appointment ,<br />{{booking_detail}}<br /><br />  Customer details as follows: <br /> {{appoinment_client_detail}} <br /><br /> Thank You, <br /> {{company_name}}', 'e'),
(11, 'Appointment Cancel By Customer', 'Appointment Cancelled By Customer', '', 'Hi {{service_provider_name}}, <br /><br /> We are sorry that appointment request for <br />{{booking_detail}}<br /> has been Cancel by Client. <br /><br />  Cancellation reason: <br /> {{appointment_cancel_reason}} <br /><br />  Customer Detail: <br /> {{appoinment_client_detail}} <br /><br /> Thank You, <br /> {{company_name}}', 'e'),
(12, 'Appointment Rejected', 'Appointment Rejected', '', 'Hi {{service_provider_name}}, <br /><br /> You have successfully rejected the following appointment<br />{{booking_detail}} <br /><br /> Reject reason: <br /> {{appointment_reject_reason}} <br /><br />  Thank You, <br /> {{company_name}},', 'e'),
(13, 'Appointment Cancel', 'Appointment Cancelled', '', 'Hi {{service_provider_name}}, <br /><br /> You have successfully cancelled the following appointment<br />{{booking_detail}} <br /><br /> Cancellation reason: <br /> {{appointment_cancel_reason}} <br /><br /> Thank You, <br /> {{company_name}}', 'e'),
(14, 'Admin Appointment Marked As No Show', 'Admin Appointment Marked As No Show', '', 'Hi {{service_provider_name}}, <br /><br />You have successfully mark the following appointment as no-show.<br />{{booking_detail}}<br /><br /> Customer Detail: <br /> {{appoinment_client_detail}} <br /><br /> Thank You, <br /> {{company_name}}', 'e'),
(15, 'Admin Appointment Reminder', 'Admin Appointment Reminder', '', 'Hi {{service_provider_name}}, <br /><br /> This is a reminder notification for following appointment<br />{{booking_detail}}  <br /><br /> Customer Detail: <br /> {{appoinment_client_detail}} <br /><br /> Thank You, <br /> {{company_name}}', 'e'),
(16, 'Appointment Completed with client', 'Appointment Completed with client', '', 'Hi {{service_provider_name}}, <br /><br /> Your appointment with following details has been completed now.<br />{{booking_detail}}<br /><br />Customer Detail: <br /> {{appoinment_client_detail}} Thank You,<br /><br /> {{company_name}}', 'e');
