(181096, '_transient_dash_88ae138922fe95674369b1cb3d215a2b', '<div class=\"rss-widget\"><ul><li><a class=\'rsswidget\' href=\'https://wordpress.org/news/2017/07/the-month-in-wordpress-june-2017/\'>The Month in WordPress: June 2017</a> <span class=\"rss-date\">July 3, 2017</span><div class=\"rssSummary\">We’re starting a new regular feature on this blog today. We’d like to keep everyone up-to-date about the happenings all across the WordPress open source project and highlight how you can get involved, so we’ll be posting a roundup of all the major WordPress news at the end of every month. Aside from other general [&hellip;]</div></li></ul></div><div class=\"rss-widget\"><ul><li><a class=\'rsswidget\' href=\'https://wptavern.com/dmitry-mayorov-discusses-the-challenges-of-organizing-wordcamp-moscow-and-the-future-of-wordpress-themes\'>WPTavern: Dmitry Mayorov Discusses the Challenges of Organizing WordCamp Moscow and the Future of WordPress Themes</a></li><li><a class=\'rsswidget\' href=\'https://wptavern.com/customize-snapshots-0-6-0-adds-the-ability-to-name-and-merge-changesets\'>WPTavern: Customize Snapshots 0.6.0 Adds the Ability to Name and Merge Changesets</a></li><li><a class=\'rsswidget\' href=\'https://wptavern.com/blog-passes-100000-registrations-66-5-of-purchased-domains-are-in-use\'>WPTavern: .blog Passes 100,000 Registrations, 66.5% of Purchased Domains are in Use</a></li></ul></div><div class=\"rss-widget\"><ul><li class=\"dashboard-news-plugin\"><span>Popular Plugin:</span> WordPress Importer&nbsp;<a href=\"plugin-install.php?tab=plugin-information&amp;plugin=wordpress-importer&amp;_wpnonce=0ae81eb108&amp;TB_iframe=true&amp;width=600&amp;height=800\" class=\"thickbox open-plugin-details-modal\" aria-label=\"Install WordPress Importer\">(Install)</a></li></ul></div>', 'no'),
