(45, 1, '2016-01-14 03:19:36', '2016-01-14 03:19:36', '<h1><strong>VI AUTOMATISERER BETALING OG VASKE PROSSESEN. </strong><strong>\r\n\r\n</strong></h1>\r\n<h2><strong>FRA OG MED 01. AUGUST 2017 SKAL ALL BESTILLING OG BETALING SKJE VIA </strong></h2>\r\n<a href=\"http://autobutler.no/wp-content/uploads/2016/01/vipps_sjgrnn.png\"><img class=\"alignnone size-medium wp-image-473\" src=\"http://autobutler.no/wp-content/uploads/2016/01/vipps_sjgrnn-300x68.png\" alt=\"\" width=\"300\" height=\"68\" /></a>\r\n\r\n<strong><em>LEVERING AV BIL FOR VASK:</em></strong><strong><em>\r\n\r\n</em></strong>\r\n<ul>\r\n 	<li>LOGG DEG INN PÅ VIPPS APPEN OG TRYKK PÅ HANDLE KNAPPEN.</li>\r\n 	<li>DER SØKER DU ETTER AUTOBUTLER DRIFT AS.</li>\r\n 	<li>DERETTER TRYKK PÅ AUTOBUTLER DRIFT, OG MENY.</li>\r\n 	<li>DER KAN DU VELGE TJENESTEN(ENE) DU ØNSKER OG BETALE FOR DET.</li>\r\n 	<li>VED BETALING LEGGER DU INN<strong> REG NR. </strong>PÅ BILEN UNDER FELTEN KOMENTAR</li>\r\n 	<li>NØKKELEN LEGGES I EN AV NØKKELBOKSENE OG LÅSES, NØKKELEN TIL BOKSEN TAR DU MED DEG.</li>\r\n</ul>\r\n<strong><em>HENTING AV BIL FRA VASK:</em></strong><strong><em>\r\n\r\n</em></strong>\r\n<ul>\r\n 	<li>NÅR DU SKAL HENTE BILEN BRUKER DU SAMME NØKKEL TIL Å ÅPNE BOKSEN OG TAR BILNØKKELENE, MENS DU LAR NØKKEL TIL BOKSEN HENGE IGJEN I LÅSEN.</li>\r\n</ul>', 'BJØRVIKA', '', 'publish', 'open', 'closed', '', 'home-2', '', '', '2017-07-30 20:52:52', '2017-07-30 20:52:52', '', 0, 'http://localhost/brizestone/?page_id=45', 0, 'page', '', 0),
