(283, 1, '2016-03-09 16:24:15', '2016-03-09 16:24:15', '<ul>\r\n	<li>AutoButler (Etb.2013) eies og driftes av Bisco Gruppen As (Org.nr: 999 619 126)\r\n<strong>2013: </strong>Lanserte Norges eneste og første mobile verksted for privatmarkedet</li>\r\n	<li><strong>2014: </strong>Ekspanderte virksomheten til å drifte elbil flåter hos større bedrifter (DNB, KPMG, MICROSOFT, ATEA osv…)\r\n<strong>2015: </strong>Åpnet 3 lokasjoner i Moss (Rygge), Oslo(Bjørvika) og Bærum(Rud)</li>\r\n	<li><strong>2016:</strong> Introduserer og lanserer pop up dekk shops til det norske markedet.</li>\r\n</ul>\r\n<strong>ANSATTE (antall/kvalitet/kompetanse)</strong>10 Stk\r\n\r\n- Alle våre ansatte er lojale, hardtarbeidende, kvalitetsbevisste og serviceinnstilte på arbeidet de utfører.\r\n- Alle våre ansatte har minimum 3 (+) års erfaring i bransje\r\n- Selskapets ledelse har bransjeerfaring siden\r\n\r\n<strong>REFERANSER (kunde portefølje)</strong>\r\n\r\n- Skotvedt\r\n- Motorforum\r\n- DNB\r\n- MoveAbout\r\n- Bilkollektivet\r\n- Røhneselmer\r\n- HBT\r\n- Relokator\r\n- Pegasus\r\nog mange fler...', 'Om oss', '', 'inherit', 'open', 'open', '', '93-revision-v1', '', '', '2016-03-09 16:24:15', '2016-03-09 16:24:15', '', 93, 'http://autobutler.no/?p=283', 0, 'revision', '', 0),
